class EllaBlunk extends React.Component<EllaProps, any> {

	constructor(props: EllaProps) {
		super(props);
	}

	render() {

		const defaultOptions = {
			loop: true,
			autoplay: true,
			animationData: blunkedamedata,
			rendererSettings: {
				preserveAspectRatio: 'xMidYMid slice'
			}
		};

		const blunkeDameAspectRatio = 100/168;
		const hoyde = this.props.hoyde ? this.props.hoyde : 168;
		const bredde = hoyde * blunkeDameAspectRatio;

		return (
			<div className="ellablunk_bakgrunn_wrapper">
				<div className="ellablunk_bakgrunn">
					<Lottie
						options={defaultOptions}
						height={hoyde}
						width={bredde}
						isStopped={this.props.erStoppet}
						isPaused={this.props.erPauset}
					/>
				</div>
			</div>
		)
	}
}

(EllaBlunk as React.ComponentClass).propTypes = {
	/**
	 * HÃ¸yde i piksler
	 */
	hoyde: PT.number,
	/**
	 * Animasjon er stoppet
	 */
	erStoppet: PT.bool,
	/**
	 * Animasjon er
	 */
	erPauset: PT.bool,
};

export default EllaBlunk;
